Defendant Christian L Daak in court with attorney Kelsey Morin.  Bryan C. Bayer appeared for the State of Wisconsin. Defendant enters a no contest plea as to count 1 and 2 and strike the enhancer on count 1. Count 2 is dismissed outright. Court imposed the following sentence:

    The Defendant was given the following:  COUNT 1

WITHHELD SENTENCE;

TERM OF PROBATION:  3 YEAR(S);

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions
*Follow through with any treatment and/or counseling recommended by Agent;
*DNA sample to be provided if not yet previously done.

COURT COSTS:  $268.00 (to be paid as a condition of probation);

DNA SURCHARGE:  $250.00 (to be paid as a condition of probation);

CONDITION TIME: 90 days, STAYED; to be used at agent's discretion.  Agent to determine with or without non working hours.  

Felony warnings, voting rights and firearms warnings given.



  The defendant was sentenced to the following:  COUNT 2

HUBER:  90 days consecutive with Huber, w/Standard Release Conditions (Credit - 4 DAYS). Sentence to commence today. 

FINE: $1494.00 to be paid as CONDITION OF PROBATION IN COUNT 1

DNA SURCHARGE:  $200.00 to be paid  as CONDITION OF PROBATION IN COUNT 1

BLOOD DRAW FEE:  $35.00 paid through Waukesha County Circuit Court to be forward to Waukesha County Sheriff's Department or to be converted to a civil judgment for non payment of fee.

D/L REVOCATION: 30 months;

IGNITION INTERLOCK:  30 months;

Attendance at a Victim Impact Panel on:  November 18, 2015. Defendant to serve 30 days huber, consecutive, as penalty for failure to attend Victim Impact Panel.

Other:  AODA ASSESSMENT AND FOLLOW THROUGH.

ANY BAIL POSTED TO BE RETURNED TO THE POSTER
